<?phpuse App\Http\Controllers\CentralCourseController;use App\Http\Controllers\CourseV2\CourseV2Controller;use App\Http\Controllers\CourseV2\LibraryController;Route::group([//    'as' => 'v2.courses'], function () {    // My courses    Route::get('index', [CourseV2Controller::class, 'getAll']);    Route::post('create', [CourseV2Controller::class, 'create']);    Route::get('get/{course}', [CourseV2Controller::class, 'getOne']);    Route::post('update');    Route::delete('delete');    // Assigned courses    Route::get('assigned', [CourseV2Controller::class, 'getAssigned']);    // Library    Route::get('library/categories', [LibraryController::class, 'getCategories']);    Route::get('library/courses', [LibraryController::class, 'getLatestCourses']);    Route::get('library/courses/{course}', [LibraryController::class, 'getCourse']);});Route::group([], function () {    Route::get('admin/central/index', [CentralCourseController::class, 'getAll']);});